import React from 'react';
import { NavLink } from 'react-router-dom';
import c from './Navbar.module.css';

const Navbar = () => {
    return (
        <nav className={c.nav}>
            <div className={c.item}>
                <NavLink to='/profile' activeClassName={screen.ActiveLink}>Profile</NavLink>
            </div>
            <div className={c.item}>
                <NavLink to='/dialogs' activeClassName={screen.ActiveLink}>Messages</NavLink>
            </div>
            <div className={c.item}>
                <NavLink to='/news' activeClassName={screen.ActiveLink}>News</NavLink>
            </div>
            <div className={c.item}>
                <NavLink to='/music' activeClassName={screen.ActiveLink}>Music</NavLink>
            </div>
            <div className={c.item}>
                <NavLink to='/settings' activeClassName={screen.ActiveLink}>Settings</NavLink>
            </div>
        </nav>
    )
}

export default Navbar;
